import './App.css';
import {Routes, Route,} from "react-router-dom";

import Navbar from './components/Navbar';
import Home from './pages/Home';
import Loan from './pages/Loan';


function App() {
  return (
    <>
    <Loan />
     <Home />

     <Routes>
        <Route path="/" element/>
     </Routes>

    </>
  );
}

export default App;
